import { ProductListProvider } from "./ProductList";
import { ProductsProvider } from "./Products";

export const Providers = ({ children }) => {
  return (
    <ProductsProvider>
      <ProductListProvider>{children}</ProductListProvider>
    </ProductsProvider>
  );
};
